import React from "react";
import ReactDOM from "react-dom";
import "./SuggestionCard.css";
import star from "../assets/star.png";

const Suggestion_card = (props) => {

    const starList = [1, 2, 3, 4, 5];
    const [rating, setRating] = React.useState(0);


    return (
        <div className="suggestion_card">
            <div>
                <p className="suggestion_card_description">{props.text}</p>
            </div>
            <div id="1" className="stars_container">
                {
                    starList.map((star, index) => (
                        <img key={index} className={index < rating ? "yellow" : "default_color"} className="suggestion_card_image" src={star} alt="suggestion_card_image" />
                    ))
                }
                
                <img className="suggestion_card_image" src={star} alt="suggestion_card_image" />
                <img className="suggestion_card_image" src={star} alt="suggestion_card_image" />
                <img className="suggestion_card_image" src={star} alt="suggestion_card_image" />
                <img className="suggestion_card_image" src={star} alt="suggestion_card_image" />
            </div>
        </div>
        
    );
}

export default Suggestion_card;
